// }

const Button = styled.button``

function App() {
  return (
    <div className="App">


      <header className="App-header">
      <h2>
        <button>Test</button>
        <Button label = "Dog"/>
        <Button label = "Cat"/>
        <Button label = "Moose"/>
        <Button label = "Beaver"/>
      </h2>
      </header>
      <MapContainer />
    </div>
  );
}

export default App;
